import React,{useState,useEffect} from 'react'
import { useSelector,useDispatch } from 'react-redux';
import {fetchData} from '../../actions/Seller';

const Customer = () => {

    const dispatch = useDispatch();
    const [loading,setLoading] = useState(true);
    const seller_Details = useSelector((state) => state.allSeller);
    console.log(seller_Details);
    useEffect(() => {
        dispatch(fetchData);
    },[]);

    const l = seller_Details.length;

    return (

        <div>
               {l ? <div>
                    <h2>Seller Details</h2>
                    {seller_Details.map((seller) => {
                        return (<div>
                        <p>{seller.name}</p>
                        <p>{seller.email}</p>
                        <p>{seller.number}</p>
                        <p>{seller.type}</p>
                        <p>{seller.pincode}</p>
                        </div>)
                    })}
                 </div>
                : <h1>Loading</h1> 
                }  


        </div>
    )
}

export default Customer
